import './style.css';
import './style1.css';
import React ,{Component} from 'react';
function Table() {

    return(
<div>
    <table id="table" >
        <tr>
    <td  >المدن</td>
    <td >عدد السكان</td>
        </tr>
{Cities.map(function data(d) {


    return(

        <tr key={d.id} >
            <td >{d.citie}</td>
            <td >{d.peples}</td>
            <td>
            <button > تعديل   </button> 
            <button  id = "delet"  onClick={() => Delet(d)} > حدف  </button> 
            </td>
        </tr>
            )   
        })}
    </table>
</div>
    )
    
}

